import React, { Component } from 'react';
import MovieCard from './MovieCard';

class MovieList extends Component {
  render() {
    const { movies } = this.props;
    return (
      movies.map((movie) => (
        <MovieCard key={movieCard.title} movies={movieCard} />
      ))
    );
  }
}

export default MovieList;
